import React,{Component} from 'react';
import Field from '../InputField';
import './login.css';
class Login extends Component{
    constructor(){
        super();
    }

    render(){
        return(<div className="mw7 center measure ">
            <Field type="email" id="email-address" name="Email"/>
            <Field/>
            <Field/>
        </div>);
    }
}
export default Login;
